import React from "react";
// import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header className="header">
      <div className="header-content">
        <h2>A'Keia M.</h2>
        <nav>
          <ul className="menu-items">
            <li>
              <a href="https://cookies-for-coders-mary.herokuapp.com">
                Portfolio
              </a>
            </li>
            <li>
              <a href="https://drive.google.com/file/d/1UdT3jGLZcXy934RVBNbWYUhjTstbIii1/view?usp=sharing">
                Resume
              </a>
            </li>
            <li>
              <a href="https://github.com/DrMcCollum">GitHub</a>
            </li>
            <li>
              <a href="">LinkedIn</a>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
